import 'bootstrap/dist/css/bootstrap.min.css';
import axios from 'axios';
import {Modal, ModalBody, ModalFooter, ModalHeader} from 'reactstrap';

import AccioBooklogo from './assets/AccioBook.png';

const ListContainer = styled.div`
  display: flex;
  flex-direction: row;
  flex-wrap: wrap;
  background-color: #ccc;
  padding: 10px;
`;

function App() {
  return (
    <div className="App">     
      <img src={AccioBooklogo} alt="Logo"/>
      <button className="btn btn-entrar">Entrar</button> 
      <Container>
        <ListContainer>
          <ListBook />
          <ListBook />
          <ListBook />
        </ListContainer>
      </Container>   
      <Quotes />        
    </div>
  );
}
export default App;
